import config from '../config';

const fetch = async ({
    url, method
}) => {
    const res = await fetch(config.serverUrl + '/api/agent', {
        headers: {
          'content-type': 'application/json',
          'api-url': url
        },
        method: 'POST',
    });
    return await res.json();
}

export default fetch
